    const Url =(text.match(/(https?:\/\/[^\s]+)/g))
    return(
    Url ? (
      <div className='bg-dark'>
      {Url}
    <a href={Url}>{Url}</a>
    </div>
    ) : ""
    )
  }
  export default getUrl;
